import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <Layout class="Inicio">
                <Head>
                    <title>Inicio</title>
                </Head>         
            </Layout>
            <div>
                <h1>Uso de Next y React</h1> 
            </div>
        <style jsx>{`
            div{
                background: #2F3540;
                width: 100%;
                height: 100vh;
            }
            h1{
                color: #F2B33D;
                text-align: center;
                padding:1em;
            }
        `}</style>
        </>
    )
}
export default Home;
